// SPDX-License-Identifier: MIT

pragma solidity ^0.8.17;

contract SHA256{
    function getFirstChar(string memory str) public pure returns (bytes1) {
        return bytes(str)[0];
    }
    function Hash(string memory _text) public pure returns (bytes32){
        return sha256(abi.encodePacked(_text));
    }
}

